class VideoInfoThread(QThread):
    """视频信息获取线程"""
    info_ready = pyqtSignal(dict)

    def __init__(self, video_path):
        super().__init__()
        self.video_path = video_path

    def run(self):
        try:
            from utils.video_info import get_video_info
            video_info = get_video_info(self.video_path)
            # 直接使用get_video_info的返回值，不使用format_video_info
            if isinstance(video_info, dict):
                self.info_ready.emit(video_info)
            else:
                self.info_ready.emit({"error": "视频信息格式错误"})
        except Exception as e:
            self.info_ready.emit({"error": f"获取视频信息失败: {str(e)}"})


class TranslationThread(QThread):
    """翻译执行线程"""
    progress_updated = pyqtSignal(str)
    finished_signal = pyqtSignal(str)

    def __init__(self, translation_params):
        super().__init__()
        self.params = translation_params

    def run(self):
        try:
            if self.params.get('srt_file_path'):
                # SRT文件翻译
                self.progress_updated.emit("开始翻译SRT文件...")
                from utils import subtitle_translator

                output_file = subtitle_translator.translate_srt_file(
                    api_key=self.params['api_key'],
                    model=self.params['model'],
                    srt_file_path=self.params['srt_file_path'],
                    output_folder=self.params['output_folder'],
                    translation_type=self.params['translation_type'],
                    batch_size=self.params['batch_size']
                )
                self.finished_signal.emit(f"翻译完成，文件保存至: {output_file}")
            else:
                # 视频翻译
                self.progress_updated.emit("开始提取视频音频...")
                from utils import audio_translator

                result = audio_translator.generate_subtitles(
                    video_path=self.params['video_path'],
                    api_key=self.params['api_key'],
                    output_path=self.params['output_path'],
                    audio_models=self.params['audio_models'],
                    text_models=self.params['text_models'],
                    mode=self.params['mode'],
                    translation_type=self.params['translation_type'],
                    batch_size=self.params['batch_size'],
                    batch_min=self.params['batch_min']
                )
                self.finished_signal.emit(f"翻译完成: {result}")
        except Exception as e:
            self.finished_signal.emit(f"翻译失败: {str(e)}")


